import { Form, FormGroup, Input, Navbar, NavbarBrand, NavItem, Nav, Collapse, NavLink, UncontrolledDropdown, DropdownToggle, DropdownItem, DropdownMenu, NavbarToggler } from 'reactstrap';
import React from 'react';

class NavBar extends React.Component{
    constructor(props) {
        super(props);
    
    }
    
    render(){
        return(
        <div>
        <Navbar color="light" light expand="md">
            {/* <NavbarBrand href="/">Image Search</NavbarBrand> */}
            {/* <Collapse navbar> */}
            <Nav classname="ms-auto">
                <NavItem>
                    <Form>
                    <Input type="text" placeholder="Search Images ..."></Input>
                    </Form>
                </NavItem>
            </Nav>
            {/* </Collapse> */}
        </Navbar>
        </div>
        
        );
    }
}

export default NavBar
